(8, 'propostas', 'Proposta Aceita - comercial', 'Portal Conecta - Proposta Aceita', '&lt;p&gt;Ol&amp;aacute;, Comercial! A Proposta N&amp;ordm; [num_proposta] foi aceita pelo cliente. O recibo de pagamento est&amp;aacute; sob an&amp;aacute;lise do Financeiro, aguarde atualiza&amp;ccedil;&amp;otilde;es.&lt;br /&gt;&lt;br /&gt;Produto: [tipo_produto]&lt;br /&gt;&lt;br /&gt;Dr(a): [nome_dr]&lt;br /&gt;&lt;br /&gt;Paciente: [nome_paciente]&lt;br /&gt;&lt;br /&gt;Para mais informa&amp;ccedil;&amp;otilde;es acesse o portal conecta pelo link https://conecta.cpmhdigital.com.br/comercial e altere os dados da proposta.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 10pt; color: #95a5a6;&quot;&gt;&amp;copy; Portal Conecta 2022&lt;/span&gt;&lt;/p&gt;', '[sistema_emailComercial]', 'vanessa', '20/12/2021 11:10:34', '25/02/2022 00:03:14', ''),
