(22, 'propostas', 'Qualificação do Cliente - Envio de Link', 'Portal Conecta - Qualificação do Cliente', '&lt;p&gt;Ol&amp;aacute;,&amp;nbsp;[nome_criador].&lt;/p&gt;\r\n&lt;p&gt;Agradecemos a confian&amp;ccedil;a com a CPMH. Notamos que voc&amp;ecirc; ainda n&amp;atilde;o est&amp;aacute; qualificado em nosso sistema de Gest&amp;atilde;o da Qualidade. Por favor preencha o formul&amp;aacute;rio de&amp;nbsp;&lt;strong data-stringify-type=&quot;\\&amp;quot;bold\\&amp;quot;&quot;&gt;Qualifica&amp;ccedil;&amp;atilde;o de Distribuidor&amp;nbsp;&lt;/strong&gt;para darmos continuidade &amp;agrave; sua solicita&amp;ccedil;&amp;atilde;o&lt;strong data-stringify-type=&quot;\\&amp;quot;bold\\&amp;quot;&quot;&gt;.&lt;/strong&gt;&lt;br /&gt;Link:&amp;nbsp;&lt;a class=&quot;\\&amp;quot;c-link\\&amp;quot;&quot; tabindex=&quot;\\&amp;quot;-1\\&amp;quot;&quot; href=&quot;\\&amp;quot;https:/form.jotform.com/GRUPOFIX/qualificao-de-clientes\\&amp;quot;&quot; target=&quot;\\&amp;quot;_blank\\&amp;quot;&quot; rel=&quot;\\&amp;quot;noopener&quot; data-stringify-link=&quot;\\&amp;quot;https://form.jotform.com/GRUPOFIX/qualificao-de-clientes\\&amp;quot;&quot; data-sk=&quot;\\&amp;quot;tooltip_parent\\&amp;quot;&quot; data-remove-tab-index=&quot;\\&amp;quot;true\\&amp;quot;&quot;&gt;https://form.jotform.com/GRUPOFIX/qualificao-de-clientes?id=[num_proposta]&lt;/a&gt;&lt;/p&gt;\r\n&lt;p&gt;Em breve entraremos em contato com a devolutiva da qualifica&amp;ccedil;&amp;atilde;o e cadastro de sua empresa junto ao nosso SGQ.&lt;br /&gt;Ficaremos muitos felizes em t&amp;ecirc;-lo como parceiro.&lt;/p&gt;\r\n&lt;p&gt;&lt;br /&gt;Em caso de d&amp;uacute;vida, estamos a disposi&amp;ccedil;&amp;atilde;o por meio do n&amp;uacute;mero (61)3028-8878&lt;br /&gt;Atenciosamente,&lt;br /&gt;Equipe CPMH&lt;span class=&quot;\\&amp;quot;c-message__edited_label\\&amp;quot;&quot; dir=&quot;\\&amp;quot;ltr\\&amp;quot;&quot; data-sk=&quot;\\&amp;quot;tooltip_parent\\&amp;quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;'